class Issue:
    def __init__(self, title, description, status='Open'):
        self.title = title
        self.description = description
        self.status = status

    def update_status(self, new_status):
        self.status = new_status


class Submission:
    submissions = {}

    def __init__(self, user, file_name):
        self.user = user
        self.file_name = file_name
        self.status = 'Pending'

    @classmethod
    def add_submission(cls, submission):
        if submission.file_name in cls.submissions:
            raise ValueError("Duplicate submission detected.")
        cls.submissions[submission.file_name] = submission

    def update_status(self, new_status):
        self.status = new_status


class UserTesting:
    def __init__(self):
        self.sessions = []

    def schedule_testing(self, date, participants):
        session = {'date': date, 'participants': participants, 'results': None}
        self.sessions.append(session)

    def report_results(self, session_index, results):
        if session_index < len(self.sessions):
            self.sessions[session_index]['results'] = results


class FileManager:
    uploaded_files = []

    @staticmethod
    def upload_file(file):
        FileManager.uploaded_files.append(file)

    @staticmethod
    def download_file(file_name):
        if file_name in FileManager.uploaded_files:
            return f"Downloading {file_name}"
        else:
            raise FileNotFoundError("File not found.")


